    if k < 2:
        return [2 % m, 16 % m][:k]
    b = [1, 2 % m, 16 % m]
    for n in range(2, k):
        b.append((n + 1) * ((2 + 4 * n) * b[n] - 4 * n ** 2 * b[n - 1] + 16 * n ** 2 * (n - 1) ** 2 * b[n - 2]) % m)
    return b[1:]

